import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Nav from './Nav';

function App(defaultProps) {
  return (
    <div className="App">
      <BrowserRouter>
      {console.log(App.dogs)}
        <Nav />
        <Routes>
          <Route path="/Perry" />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
